                    { "000ebf83-36ef-43eb-9e59-c08a8570e65d", "les 3 sont bonnes mais à ta place je choisirais sans doute la plus équipée, si t as pas de contraintes budgétaires, la classe A AMG serait la meilleure à mon avis, mais si c’est hors budget, opter pour la A3 sline serait de loin meilleur parce qu elle est bcp plus équipée que la classe A progressive… recap:\n- class A Amg\n- audi A3 s line\n- BMW 1 series pack M\n- golf 8 r line\n- mercedes A progressive", "69e4294b-4eb4-470a-9161-ea9f5206e267", "1966842e-77ce-48c6-b276-5124fe23b7f5" },
                    { "00832fea-cd3d-46aa-82d9-10a17a786b32", "C'est normal, avant qu'il soit livré un véhicule doit circuler à la fin de la chaine de montage vers le lieu de stockage, partir vers les ports d'export rentrer sortir des bateaux, aller chez le concessionnaire ... et des fois il subit un essai de validation en usine.\nLes adhésifs son enlevés par le concessionnaire sa rentre dans la préparation du véhicule.\nInquiétez vous pas vous êtes le premier usager. MABROUK", "1b57a1b2-39b4-4fda-b3eb-9911348915c4", "da6c9860-134d-4371-a146-08c36e553c35" },
                    { "00b5a3dc-b638-4e94-a1fe-6d8d46d87866", "Pour les voiture chinoises, côté fiabilité, tant que c'est commercialisé dans les pays du glof, il ne faut pas se méfier. Je vois conseil de jeter un coup d'œil sur la gac gs3, c'est une bonne voiture avec une motorisatio turbo et une bonne qualité de matériaux et de finition.", "8decdbfb-d17e-46ee-b78e-6948d6b8d8e5", "683b81d2-24da-4b9f-b99e-b03c8a915c4a" },
                    { "00c3ca78-e832-4d8b-81dc-98cfd1ee0c4c", "Najam nkalmk en prié stp?", "ea3762d2-001b-4e2c-9d5b-afc96322f949", "dc326765-fd9d-4327-9def-8f2938eb4ca5" },
                    { "00d8500e-2f3b-427c-abc1-c7ce65f88db2", "Inshallah Mabrouk.\nJe pense qu'on a choisi un véhicule de bonne qualité, fiable (surtout la boîte cvt de la marque Bosh)\nAttends toi a une augmentation du prix pour le prochain arrivage  ( comme la commerciale me l'a dit) .\nPour ce genre de crossover (a mon avis) les deux couleurs qui peuvent aller a merveille dessus sont le noir ou le gris . D'ailleurs la plupart des suv qu'on voit dans le monde sont soit noir ou gris et rarement des blanches.", "ea3762d2-001b-4e2c-9d5b-afc96322f949", "e5dc8bc0-d80c-4da7-96fa-f670eaec5030" },
