                    { "064f6460-8276-4f29-9ad3-bca88321f62d", "Salut,\n1) concernant la Seat Ateca ou le Tiguan je vois toujours le 1.4 TSI en vente. Ce moteur n'étant plus fabriqué en Europe depuis quelques années je voulais savoir si acheter le 1.5 TSI en fcr représente un risque notamment en terme de qualité de carburant en Tunisie. D'ailleurs je ne vois nulle part ce moteur en vente chez les concession en Tunisie, il doit y avoir une raison ?\n2) Par ailleurs le tiguan n'a pas trop la côte en Tunisie contrairement a des pays comme l'Allemagne et la France je n'ai pas compris pourquoi.\n3) Enfin la fameuse dgs7 (double embrayage) est à priori une bonne boite à condition de bien l'entretenir, Vidange tous les 60000 kms, d'après certains, tous les 80000 ou 120000 d'après d'autres notamment les concessions officielles. Bref je vois qu'à l'étranger il faut vraiment avoir des compétences costauds pour réparer ces boîtes, notamment le mecatronique et compagnie...je me pose donc la question si en Tunisie des spécialistes existent pour ce type de réparation mais aussi pour les opérations d'entretien (Vidanges).\nD'ailleurs de ce que j'ai compris peu importe le type de boite auto, double embrayage, convertisseur de couple ou variation continue, l'entretien est nécessaire.\nVoilà donc les 3 sujets pour lesquels je voulais avoir l'avis des connaisseurs présents sur ce site.\nMerci d'avance", "e5e2355a-1f22-440c-b457-8b2e7f47a0e8", "b8383f36-41da-437e-a67f-d85ad140cb5d" },
