                    { "8b68f3c2-b528-4b94-a0ea-f4c30e6579ff", "C'est quoi la diiférence entre le (1.4 TSI 150 CV); et le (1.5 TSI 150 CV)\nj'ai constaté que les seat leon importées de l'europe sont equipées d'un moteur 1.5 et la Tunisienne 1.4.\nj'ai aussi entendu parler que le 1.5 aura des problèmes avec la qualité du carburant en Tunisie.\n\nMerci d'avance pour vos réponses", "ab1b3adc-4cc3-4535-93a5-63554cd647b6", "2961c4f6-218d-4dc9-8139-0bf892883924" },
