                    { "f26996a0-2a71-4cce-8568-31836b14c33c", "Bonjour,\nLes moteurs 1.4 TSI et 1.5 TSI ont des exigences similaires en matière de qualité de carburant.\nLe 1.4 TSI optimisé en 2015, a été adapté à la norme Euro 6, tandis que le 1.5 TSI lancé en 2017, a été conçu directement pour cette norme.\n\nLa principale différence entre les deux moteurs réside dans l’intégration de la technologie ACT (Active Cylinder Technology) sur le 1.5 TSI, qui permet de désactiver temporairement deux cylindres afin de réduire la consommation de carburant.\n\nPar contre en Tunisie, où le carburant disponible est de norme Euro 3, ces moteurs nécessitent un entretien plus fréquent pour préserver leurs performances et leur durabilité. Cela inclut notamment :\n• Un nettoyage régulier des injecteurs et de la vanne EGR,\n• Une vidange tous les 10 000 km,\n• L’utilisation de carburant de meilleure qualité si possible comme Shell V-Power et Total Excellium .", "5c78e08d-7727-4c1c-b3aa-9722b59ca427", "76b47285-d44d-4fa6-8120-9e832d90d046" },
